import React from "react";
import styled from "styled-components";

const AlbumContainer = (props) => {

    const MainBox = styled.div`
        display : flex;
        width : 100%;
        height : 1500px;
        background-color : ${(props) => (props.boxColor ? props.boxColor : "white")};
        justify-content : center;
        align-items : center;
    `

    const AlbumBox = styled.div`
        display : flex;
        width : 300px;
        height : 400px;
        border-radius : 5px;
        flex-direction : row;
        justify-content : center;
        background-color : black;
    `

    const AlbumButton = styled.a`
        display : flex;
        margin-top: 25px;
        border-radius : 5px;
        width : 150px;
        height : 30px;
        background-color : ${(props) => (props.abuttonColor ? props.abuttonColor : "white")};
        justify-content: center;
        align-items : center;
        margin-left : 5px;
    `

    const AButtonName = styled.p`
        color : white;
    `

    return (
        <>
            <MainBox>
                <AlbumBox>
